type: object
properties:
  symbol:
    type: string
    example: BTCUSDT
  orderId:
    type: integer
    format: int64
    example: 28
  orderListId:
    type: integer
    format: int64
    example: -1
  clientOrderId:
    type: string
    example: 6gCrw2kRUAF9CvJDGP16IP
  transactTime:
    type: integer
    format: int64
    example: 1507725176595
required:
- symbol
- orderId
- orderListId
- clientOrderId
- transactTime
